g object is masked from ‘package:purrr’:\n","\n","    compact\n","\n","\n","\n","Attaching package: ‘lubridate’\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    date, intersect, setdiff, union\n","\n","\n","\n","Attaching package: ‘scales’\n","\n","\n","The following object is masked from ‘package:purrr’:\n","\n","    discard\n","\n","\n","The following object is masked from ‘package:readr’:\n","\n","    col_factor\n","\n","\n","\n","Attaching package: ‘reshape2’\n","\n","\n","The following object is masked from ‘package:tidyr’:\n","\n","    smiths\n","\n","\n"]}],"source":["##load library\n","\n","library(tidyverse)\n","library(janitor)\n","library(skimr)\n","library(plyr)\n","library(dplyr)\n","library(lubridate)\n","library(ggplot2)\n","library(scales)\n","library(reshape2)\n"]},{"cell_type":"markdown","id":"14e3b08d","metadata":{"_cell_guid":"b13449f5-708a-494f-a1d5-bcfaf2578696","_uuid":"36eab53c-f5a6-4d45-bfc6-2fb1f4b73a28","papermill":{"duration":0.125803,"end_time":"2022-03-07T12:24:13.590495","exception":false,"start_time":"2022-03-07T12:24:13.464692","status":"completed"},"tags":[]},"source":["<a id=\"14\"></a>\n","### 3.2 Importing the Data Sets\n","\n","On closer observation, many of the CSV files contain the same data, but are divided into different files based on splitting activity by minutes, hours or per day. Furthermore, there is a file called **dailyActivity_merged**, documenting calories, daily intensities and steps merged into one, which we will be using for convenience. We will using this file, and also the **Weight Log**, and **Sleep Log**.\n","\n"]},{"cell_type":"code","execution_count":2,"id":"e8524dc1","metadata":{"execution":{"iopub.execute_input":"2022-03-07T12:24:13.873429Z","iopub.status.busy":"2022-03-07T12:24:13.844569Z","iopub.status.idle":"2022-03-07T12:24:14.201231Z","shell.execute_reply":"2022-03-07T12:24:14.199856Z"},"papermill":{"duration":0.486744,"end_time":"2022-03-07T12:24:14.201405","exception