},{"cell_type":"markdown","id":"98f8234f","metadata":{"papermill":{"duration":0.149675,"end_time":"2022-03-07T12:24:17.676717","exception":false,"start_time":"2022-03-07T12:24:17.527042","status":"completed"},"tags":[]},"source":["The only dataframe with missing values was the **weight_log**, where almost all participants did not use the fat (assuming body fat percentage) tracker. This is perhaps down to the availibility of body fat percentage measuring tools. However, we will not remove these rows as the rest of the row could prove useful.\n","\n","Despite only one dataset showing null values, from the previews we can clearly see that other null fields have been automatically populated with the value 0. We will deal with these later, when necessary. \n","\n","I want to have a closer look and count the number of unique IDs in the data, as we know there should be 30 participants."]},{"cell_type":"code","execution_count":7,"id":"59ec21fa","metadata":{"execution":{"iopub.execute_input":"2022-03-07T12:24:17.98774Z","iopub.status.busy":"2022-03-07T12:24:17.98633Z","iopub.status.idle":"2022-03-07T12:24:18.025045Z","shell.execute_reply":"2022-03-07T12:24:18.023733Z"},"papermill":{"duration":0.195348,"end_time":"2022-03-07T12:24:18.025198","exception":false,"start_time":"2022-03-07T12:24:17.82985","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["33"],"text/latex":["33"],"text/markdown":["33"],"text/plain":["[1] 33"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["8"],"text/latex":["8"],"text/markdown":["8"],"text/plain":["[1] 8"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["24"],"text/latex":["24"],"text/markdown":["24"],"text/plain":["[1] 24"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["33"],"text/latex":["33"],"text/markdown":["33"],"text/plain":["[1] 33"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["33"],"text/latex":["33"],"text/markdown":["33"],"text/plain":["[1]