ow>2</th><td>Fairly active minutes </td><td> 12751</td><td>1.25% </td></tr>\n","\t<tr><th scope=row>3</th><td>Lightly active minutes</td><td>181201</td><td>17.71%</td></tr>\n","\t<tr><th scope=row>4</th><td>Sedentary minutes     </td><td>809084</td><td>79.10%</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A data.frame: 4 × 3\n","\\begin{tabular}{r|lll}\n","  & activity\\_level & total\\_minutes & percent\\\\\n","  & <chr> & <dbl> & <chr>\\\\\n","\\hline\n","\t1 & Very active minutes    &  19862 & 1.94\\% \\\\\n","\t2 & Fairly active minutes  &  12751 & 1.25\\% \\\\\n","\t3 & Lightly active minutes & 181201 & 17.71\\%\\\\\n","\t4 & Sedentary minutes      & 809084 & 79.10\\%\\\\\n","\\end{tabular}\n"],"text/markdown":["\n","A data.frame: 4 × 3\n","\n","| <!--/--> | activity_level &lt;chr&gt; | total_minutes &lt;dbl&gt; | percent &lt;chr&gt; |\n","|---|---|---|---|\n","| 1 | Very active minutes    |  19862 | 1.94%  |\n","| 2 | Fairly active minutes  |  12751 | 1.25%  |\n","| 3 | Lightly active minutes | 181201 | 17.71% |\n","| 4 | Sedentary minutes      | 809084 | 79.10% |\n","\n"],"text/plain":["  activity_level         total_minutes percent\n","1 Very active minutes     19862        1.94%  \n","2 Fairly active minutes   12751        1.25%  \n","3 Lightly active minutes 181201        17.71% \n","4 Sedentary minutes      809084        79.10% "]},"metadata":{},"output_type":"display_data"}],"source":["# First add the column totals for activity \n","\n","vam <- sum(filtered_activity$very_active_minutes)\n","fam <- sum(filtered_activity$fairly_active_minutes)\n","lam <- sum(filtered_activity$lightly_active_minutes)\n","sam <- sum(filtered_activity$sedentary_minutes)\n","\n","# Calculate sum of overall total activity \n","\n","activity_sum <- sum(vam,fam,lam,sam)\n","\n","# Create a new data frame \n","\n","activity <- data.frame(\n","    \n","    activity_level = c(\"Very active minutes\", \"Fairly active minutes\",\n","                         \"Lightly active minutes\", \"Sedentary minutes\"),\n","    \n","    total_minutes=c(vam, fam, lam, sam))\n","    \n","# Add a new column to show percentage proportions\n","# Nested function\n","\n","activity$percent <- scales::percent((activity$total_minutes/activity_sum), accuracy = 0.01)\n","\n","head(activity)"]},{"cell_type":"markdown","id":"2b1e2070","metadata":{"papermill":{"duration":0.183773,"end_time":"2022-03-07T12:24:22.346067","exception":false,"start_time":"2022-03-07T12:24:22.162294","status":"completed"},"tags":[]},"source":["Now that the data we need is summarised in a data frame, we can go ahead and create a pie chart. "]},{"cell_type":"code","execution_count":12,"id":"cd9901d5","metadata":{"execution":{"iopub.execute_input":"2022-03-07T12:24:22.707184Z","iopub.status.busy":"2022-03-07T12:24:22.705461Z","iopub.status.idle":"2022-03-07T12:24:23.366864Z","shell.execute_reply":"2022-03-07T12:24:23.358007Z"},"papermill":{"duration":0.841958,"end_time":"2022-03-07T12:24:23.367031","exception":false,"start_time":"2022-03-07T12:24:22.525073","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd1wT5x8H8O9dFiGBEPYeAooKDtx71j1wVqt11Lq1bqu1rVZrq62t1WqtddWf\n1apt3Vr3rFoVXDhAtKAgyJK9QpL7/RFrFREDBA6Oz/uPviRcnvuEUPPx7p7nGI7jCAAAAAAq\nP5bvAAAAAABgGih2AAAAAAKBYgcAAAAgECh2AAAAAAKBYgcAAAAgECh2AAAAAAKBYgcAAAAg\nECh2AAAAAAKBYgcAAAAgECh2AAAAAAKBYgcAAAAgECh2AAAAAAKBYgcAAAAgECh2AAAAAAKB\nYgcAAAAgECh2AAAAAAKBYgcAAAAgECh2AAAAAAKBYgcAAAAgECh2AAAAAAKBYgcAAAAgECh2\nAAAAAAKBYgcAAAAgECh2AAAAAAKBYgcAAAAgECh2AAAAAAKBYgcAAAAgECh2AAAAAAKBYgcA\nAAAgECh2AAAAAAKBYgcAAAAgECh2AAAAAAKBYgcAAAAgECh2AAAAAAKBYgcAAAAgECh2AAAA\nAAKBYgcAAAAgECh2AAAAAAKBYgcAAAAgECh2AAAAAAKBYgcAAAAgECh2AAAAAAKBYgcAAAAg\nECh2AAAAAAKBYgcAAAAgECh2AAAAAAKBYgcAAAAgECh2AAAAAAKBYgcAAAAgECh2AAAAAAKB\nYgcAAAAgECh2AAAAAAKBYgcAAAAgECh2AAAAAAKBYgcAAAAgECh2AAAAAAKBYgcAAAAgECh2\nAAAAAAKBYgcAAAAgECh2AAAAAAKBYgcAAAAgECh2AAAAAAKBYgcAAAAgECh2AAAAAAKBYg