wn","id":"8b5b4f08","metadata":{"papermill":{"duration":0.222571,"end_time":"2022-03-07T12:24:37.366487","exception":false,"start_time":"2022-03-07T12:24:37.143916","status":"completed"},"tags":[]},"source":["<a id=\"25\"></a>\n","#### 4.2.2 Do participants who use the weight function tend to be more active?\n","\n","To do this, we will explore the average sedentary minutes of those who use the weight function, and compare that to those who don't."]},{"cell_type":"code","execution_count":27,"id":"c396255f","metadata":{"execution":{"iopub.execute_input":"2022-03-07T12:24:37.804277Z","iopub.status.busy":"2022-03-07T12:24:37.802664Z","iopub.status.idle":"2022-03-07T12:24:38.065241Z","shell.execute_reply":"2022-03-07T12:24:38.063756Z"},"papermill":{"duration":0.483345,"end_time":"2022-03-07T12:24:38.065423","exception":false,"start_time":"2022-03-07T12:24:37.582078","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 33 × 3</caption>\n","<thead>\n","\t<tr><th scope=col>id</th><th scope=col>avg_sedentary_mins</th><th scope=col>log</th></tr>\n","\t<tr><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>1503960366</td><td> 828.4333</td><td>Weight log   </td></tr>\n","\t<tr><td>1624580081</td><td>1257.7419</td><td>No weight log</td></tr>\n","\t<tr><td>1644430081</td><td>1161.8667</td><td>No weight log</td></tr>\n","\t<tr><td>1844505072</td><td>1078.7778</td><td>No weight log</td></tr>\n","\t<tr><td>1927972279</td><td>1232.7500</td><td>Weight log   </td></tr>\n","\t<tr><td>2022484408</td><td>1112.5806</td><td>No weight log</td></tr>\n","\t<tr><td>2026352035</td><td> 689.4194</td><td>No weight log</td></tr>\n","\t<tr><td>2320127002</td><td>1220.0968</td><td>No weight log</td></tr>\n","\t<tr><td>2347167796</td><td> 727.4706</td><td>No weight log</td></tr>\n","\t<tr><td>2873212765</td><td>1097.1935</td><td>Weight log   </td></t