eight log    934.0249          "]},"metadata":{},"output_type":"display_data"}],"source":["#finding the average sedentary activity for each person\n","sedentary_data <- filtered_activity %>%\n","group_by(id) %>%\n","dplyr::summarise(avg_sedentary_mins =mean(sedentary_minutes))\n","#View(sedentary_data)\n","\n","# Merging activity and weight table with a left join\n","activity_weight <- merge(sedentary_data, weight_log,by= c(\"id\" = \"id\"), all.x=TRUE) \n","#View(activity_weight)\n","# selecting the columns of interest\n","activity_weight <- select(activity_weight, id, avg_sedentary_mins, weight_kg) \n","# adding a new column\n","activity_weight <- activity_weight %>%\n","mutate(log = case_when(\n","    is.na(weight_kg) ~ \"No weight log\",\n","    !is.na(weight_kg) ~ \"Weight log \"\n","    ))\n","\n","#removing the weight column and getting rid of duplicates\n","activity_weight <- distinct(select(activity_weight, id,avg_sedentary_mins, log))\n","View(activity_weight)\n","#summarising by log category\n","av_sedentary <- activity_weight %>%\n","group_by(log) %>%\n","dplyr::summarise(avg_sedentary_mins =mean(avg_sedentary_mins))\n","View(av_sedentary)\n"]},{"cell_type":"code","execution_count":28,"id":"5f534b94","metadata":{"execution":{"iopub.execute_input":"2022-03-07T12:24:38.51477Z","iopub.status.busy":"2022-03-07T12:24:38.513075Z","iopub.status.idle":"2022-03-07T12:24:38.708618Z","shell.execute_reply":"2022-03-07T12:24:38.707236Z"},"papermill":{"duration":0.423351,"end_time":"2022-03-07T12:24:38.708755","exception":false,"start_time":"2022-03-07T12:24:38.285404","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeZxN9R/H8c+5986d1eyDGfuMse/ZRpaEohAxVLK2CZUilJLwUymSLbRpIWRJ\nhLIrSyEqS/ZdGIYx+3Lv+f1xmcas596ZOzOO1/MPj7nfc+49n/M993zv2zn3nKuoqioAAAC4\n8xmKugAAAAAUDIIdAACAThDsAAAAdIJgBwAAoBMEOwAAAJ0g2AEAAOgEwQ4AAEAnCHYAAAA6\ncRcFO9UaX8XDrCiKwWjeHZda1OUUMUvSmc/eeaVdszpB