-03-07T12:24:39.60509","exception":false,"start_time":"2022-03-07T12:24:39.382377","status":"completed"},"tags":[]},"source":["<a id=\"26\"></a>\n","### 4.3 Sleep Tracker\n","\n","I will use the sleep data to analyse sleep habits of participants.\n","\n","<a id=\"27\"></a>\n","#### 4.3.1 Breakdown of Hours Slept per Night\n","\n","To see the breakdown of sleep, I will create a histogram to show how much the participants slept each night during the data collection period."]},{"cell_type":"code","execution_count":29,"id":"1cd97dc0","metadata":{"execution":{"iopub.execute_input":"2022-03-07T12:24:40.055567Z","iopub.status.busy":"2022-03-07T12:24:40.054217Z","iopub.status.idle":"2022-03-07T12:24:40.09201Z","shell.execute_reply":"2022-03-07T12:24:40.090542Z"},"papermill":{"duration":0.267913,"end_time":"2022-03-07T12:24:40.092168","exception":false,"start_time":"2022-03-07T12:24:39.824255","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 6 × 3</caption>\n","<thead>\n","\t<tr><th></th><th scope=col>day</th><th scope=col>variable</th><th scope=col>value</th></tr>\n","\t<tr><th></th><th scope=col>&lt;fct&gt;</th><th scope=col>&lt;fct&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><th scope=row>1</th><td>Sunday   </td><td>time_asleep</td><td>452.7455</td></tr>\n","\t<tr><th scope=row>2</th><td>Monday   </td><td>time_asleep</td><td>419.5000</td></tr>\n","\t<tr><th scope=row>3</th><td>Tuesday  </td><td>time_asleep</td><td>404.5385</td></tr>\n","\t<tr><th scope=row>4</th><td>Wednesday</td><td>time_asleep</td><td>434.6818</td></tr>\n","\t<tr><th scope=row>5</th><td>Thursday </td><td>time_asleep</td><td>401.2969</td></tr>\n","\t<tr><th scope=row>6</th><td>Friday   </td><td>time_asleep</td><td>405.4211</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A data.frame: 6 × 3\n","\\begin{tabular}{r|lll}\n","  & day & variable & value\\\\\n","  & <fct> & <fct> & <dbl>\\\\\n","\\