},"tags":[]},"source":["----------------------\n","\n","<a id=\"30\"></a>\n","## 5.0 Share\n","\n","<a id=\"31\"></a>\n","### 5.1 Key Findings\n","\n","From the data presented, we determined the following:\n","\n","*  Most people tend to spend most of their day sedentary, however, participants achieved a mean average of 38 moderate-high active minutes a day, consistent with [CDC](https://www.cdc.gov/physicalactivity/basics/adults/) guidelines. Sedentary data also accounted for the time spent asleep, which is also why it is high.\n","*  There was a gradual decline in tracker usage over the sampling period.\n","*  Participants averaged a total of 8445.851 steps daily, lower than the 10,000 recommended by CDC. However, it does not take into account whether participants chose to do other aerobic activities such as cycling or swimming. Thus, it isn't a complete indicator of physical fitness. \n","*  Most of the participants that used the weight function did not really see much of a change over the sample period however, those that used the weight function averaged slightly less sedentary minutes than those without weight logs.\n","*  Most participants were consistent with tracker use during the day, but use dropped during the night. Those that were consistent with tracking during the night usually received enough sleep, consistent with Sleep Foundation guidelines.\n","*  There doesn't seem to be any indication that a more active day lead to longer sleep times.\n","\n","<a id=\"32\"></a>\n","### 5.2 Further Data Limitations\n","\n","Further Data limintation issues were discovered during the cleaning and analysing process, including, but not limited to:\n","\n","* Inconsistencies with certain functions such as step count being registered when participants did not wear the device. \n","* Total active and sedentary minutes not adding up to a 24 hour day.\n","* Lack of ethnicity data, age and sex of participants, which may affect BMI range and sleep recommendations, as well as overall activity and calories burned.\n","* Lack of information pertaining to type of device used by participants, which may for example, not have sleep tracker functions.\n","\n","<a id=\"33\"></a>\n","### 5.3 Recommendations\n","\n","Based on the findings and limitations, we make the following recommendations to Bellabeat:\n","\n","1. Allow customers to create a profile for themselves to get the best, and a more personalised use out of their device by allowing them to record their biometric data, including ethnicity, and overall health, and develop a platform or community where customers can interact with each other. Tailor health reminders based on the biometrics.\n","2. On the platform, encourage engagement and physical fitness through weekly or monthly challenges, perhaps with prizes and incentives.\n","3. Encourage use of the weight tracker, perhaps by allowing the app to link to other apps, such as calorie counters, and give weekly or monthly weigh-in reminders, if they opt for those.\n","4. Encourage use of the sleep tracker function, by reinforcing the impact of sleep on one's overall health, and allow for a detailed breakdown of sleep quality.\n","5. Regular reminders to take breaks and walk around in order to encourage a higher step count. As most of Bellabeat's products do not have an interactive screen, this could be through phone notifications or a vibration.\n","6. Allow workout personalisation by allowing customers to select from a list of built in exercises, so that step count doesn't become the sole indicator for physical fitness.\n","7. Design devices with a mind to maintain tracker use over time. This can possibly achieved by improving functions such as aesthetic look, battery time, and female oriented applications such as a menstrual tracker, output speaker for phone calls.\n","\n","**Although these are the recommendations we put forward, we highly encourage the procurement of further data pertaining to smart fitness devices, in order to get a better all round picture of the market.**\n"]},{"cell_type":"markdown","id":"3de5cd85","metadata":{"papermill":{"duration":0.28026,"end_time":"2022-03-07T12:24:48.302305","exception":false,"start_time":"2022-03-07T12:24:48.022045","status":"completed"},"tags":[]},"source":["-----------------\n","\n","<a id=\"34\"></a>\n","## References\n","\n","1. Kaggle.com. 2022. FitBit Fitness Tracker Data. [online] Available at: <https://www.kaggle.com/arashnic/fitbit> \n","\n","2. Centers for Disease Control and Prevention. 2022. Move More; Sit Less. [online] Available at: <https://www.cdc.gov/physicalactivity/basics/adults/> \n","\n","3. Kaggle.com. 2022. FitBit Fitness Tracker Data. [online] Available at: <https://www.kaggle.com/arashnic/fitbit> \n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":42.112139,"end_time":"2022-03-07T12:24:48.660666","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-03-07T12:24:06.548527","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}